import Head from "next/head";
import Layout, { siteTitle } from "../component/Layout";

const Home = () => {
  return (
    <Layout home>
      <Head>
        <title>{siteTitle}</title>
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css"
        ></link>
      </Head>
    </Layout>
  );
};

export default Home;
